import React from 'react'

class Main extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <main className="content">
        <section className="profile">
          <div className="profile__avatar-container">
            <div className="profile__avatar-overlay" onClick={this.handleEditAvatarClick}></div>
            <img className="profile__avatar" src="<%=require('./images/profile-avatar.jpg')%>" alt="Аватар пользователя" />
          </div>
          <div className="profile__info">
            <div className="profile__info-line">
              <h1 className="profile__username"></h1>
              <button className="profile__edit-button" type="button" onClick={this.props.onEditProfile}></button>
            </div>
            <div className="profile__info-line">
              <p className="profile__user-bio"></p>
            </div>
          </div>
          <button className="profile__add-button" type="button" onClick={this.handleAddPlaceClick}></button>
        </section>

        <section className="elements">
          <ul className="elements__grid"></ul>
        </section>
      </main>
    );
  }
}

export default Main
